import ProvisionedService from "../types/provisioned-service";

/**
 * Mock client for retrieving and parsing Provisioned Services.
 */
export default class MockProvisionedServiceClient {
  /**
   * Retrieve a {@link ProvisionedService} from a namespace, by name.
   * @returns {Promise<ProvisionedService>}
   */
  static getProvisionedService() {
    return Promise.resolve(this.buildMockProvisionedService());
  }

  /**
   * Retrieve a randomly named {@link ProvisionedService}
   * @returns {Promise<ProvisionedService[]>}
   */
  static listProvisionedServices() {
    return Promise.resolve([this.buildMockProvisionedService(), this.buildMockProvisionedService(), this.buildMockProvisionedService()]);
  }

  /**
   * Create a mock provisioned service.
   * @private
   * @returns {ProvisionedService}
   */
  static buildMockProvisionedService() {
    const identifier = MockProvisionedServiceClient.randomIdentifier();
    return new ProvisionedService(`mock-service-${identifier}`,
      `https://mock-service-${identifier}.com/`, `mock-service-${identifier}-name`);
  }

  /**
   * Generate a random identifier for the client.
   * @private
   * @returns {number}
   */
  static randomIdentifier() {
    return Math.floor(Math.random() * (9999 - 1000 + 1)) + 1000;
  }
}

import ClusterServiceClass from "../types/cluster-service-class";
import ServiceInstance from "../types/service-instance";
import ProvisionedService from "../types/provisioned-service";

/**
 * Client for retrieving and parsing Provisioned Services.
 */
export default class ProvisionedServiceClient {
  /**
   * Construct a {@link ProvisionedServiceClient}
   * @constructor
   * @param {string} openshiftURL
   */
  constructor(openshiftURL, unauthorizedHandler) {
    this.openshiftURL = openshiftURL;
    this.unauthorizedHandler = unauthorizedHandler;
  }

  /**
   * Retrieve a {@link ProvisionedService} from a namespace, by name.
   * @param {string} authToken The auth token for a user.
   * @param {string} namespace The namespace to find the service in.
   * @param {string} name The name of the service to retrieve.
   */
  getProvisionedService(authToken, namespace, name) {
    return this.listProvisionedServices(authToken, namespace)
      .then((provisionedServices) => {
        if (!provisionedServices || (provisionedServices.length === 0)) {
          return Promise.reject(new Error(`Provisioned service with the name ${name} not found in namespace ${namespace}`));
        }
        return provisionedServices.find(provisionedService => provisionedService.name === name);
      })
      .then((provisionedService) => {
        if (!provisionedService) {
          return Promise.reject(new Error(`Provisioned service with the name ${name} not found in namespace ${namespace}`));
        }
        return provisionedService;
      });
  }

  /**
   * Retrieve a list of {@link ProvisionedService} from a namespace.
   * @param {string} authToken
   * @param {string} namespace
   */
  listProvisionedServices(authToken, namespace) {
    return Promise.all([
      this.listClusterServiceClasses(this.openshiftURL, authToken),
      this.listServiceInstances(this.openshiftURL, authToken, namespace)])
      .then(([clusterServiceClasses, serviceInstances]) => {
        if (!serviceInstances || (serviceInstances.length === 0)) {
          return [];
        }
        return serviceInstances.map((serviceInstance) => {
          const displayName = clusterServiceClasses.find(serviceClass => serviceClass.name === serviceInstance.clusterServiceClassId);
          return new ProvisionedService(serviceInstance.name, serviceInstance.consoleURL, displayName);
        });
      });
  }

  responseHandler(response) {
    if (response.ok) {
      return response.json();
    } else if (response.status === 401) {
      this.unauthorizedHandler();
      return;
    } else {
      var error = new Error(response.statusText)
      error.response = response
      throw error
    }
  }

  /**
   * Retrieve a list of {@link ServiceInstance} from a namespace in OpenShift.
   * @private
   * @param {string} openshiftURL An OpenShift URL.
   * @param {string} authToken An auth token for a user.
   * @param {string} namespace The namespace to list the service instances from.
   * @returns {Promise<ServiceInstance[]>}
   */
  listServiceInstances(openshiftURL, authToken, namespace) {
    if (!authToken) {
      return Promise.reject(new Error("Auth token should not be null"));
    }

    const headers = new Headers({
      Authorization: `Bearer ${authToken}`,
    });
    return fetch(this.buildServiceInstanceListRoute(openshiftURL, namespace), { headers })
      .then(this.responseHandler.bind(this))
      .then(jsonData => jsonData.items.map(serviceInstanceJSON => ServiceInstance.fromJSON(serviceInstanceJSON)));
  }

  /**
   * Retrieve a list of {@link ClusterServiceClass} in OpenShift.
   * @private
   * @param {string} openshiftURL An OpenShift URL.
   * @param {string} authToken An auth token for a user.
   * @returns {Promise<ClusterServiceClass[]>}
   */
  listClusterServiceClasses(openshiftURL, authToken) {
    if (!authToken) {
      return Promise.reject(new Error("Auth token should not be null"));
    }

    const headers = new Headers({
      Authorization: `Bearer ${authToken}`,
    });
    return fetch(this.buildClusterServiceClassListRoute(openshiftURL), { headers })
      .then(this.responseHandler.bind(this))
      .then(jsonData => jsonData.items.filter(serviceClassJSON => ClusterServiceClass.isValidJSON(serviceClassJSON)))
      .then(jsonData => jsonData.map(serviceClassJSON => ClusterServiceClass.fromJSON(serviceClassJSON)));
  }

  /**
   * Return a valid route for retrieving service instances from OpenShift.
   * @private
   * @param {string} openshiftURL The URL of OpenShift
   * @param {string} namespace The namespace to retrieve the service instances from
   */
  buildServiceInstanceListRoute(openshiftURL, namespace) {
    return `${openshiftURL}/apis/servicecatalog.k8s.io/v1beta1/namespaces/${namespace}/serviceinstances`;
  }

  /**
   * Build a valid route for retrieving cluster service classes from OpenShift.
   * @private
   * @param {string} openshiftURL The URL of OpenShift
   */
  buildClusterServiceClassListRoute(openshiftURL) {
    return `${openshiftURL}/apis/servicecatalog.k8s.io/v1beta1/clusterserviceclasses`;
  }
}

import ProvisionedServiceClient from "./clients/provisioned-service-client";
import MockProvisionedServiceClient from "./clients/mock-provisioned-service-client";
import ClientOAuth2 from "client-oauth2"

/**
 * Provides a set of functions for retrieving various OpenShift resources and
 * parsing them into a specific format.
 */
export default class OpenShiftResourceParser {
  /**
   * Construct a new {@link OpenShiftResourceParser}
   * @param {Object} config Configuration for the parser.
   * @param {boolean} config.mockData Whether the parser should use mock data or not. If true, all other config is ignored.
   * @param {clientId} config.clientId ID of the OAuthClient in OpenShift
   * @param {accessTokenUri} config.accessTokenUri : Access Token URI in OpenShift
   * @param {authorizationUri} config.authorizationUri : Authorization URI in OpenShift
   * @param {redirectUri} config.redirectUri : Redirect URI for the OAuth Flow after retrieving a token
   * @param {scopes} config.scopes : User Scopes to request in the OAuth Flow
   * @param {masterUri} config.masterUri : OpenShift Master URI for making resource API calls
    */
  constructor(config) {
    this.config = config;
    if (!this.config.mockData) {
      this.provisionedServiceClient = new ProvisionedServiceClient(this.config, this.startOAuth);
    }
  }

  /**
   * Attempts to load the user details from local storage, returning a Promise
   * with the user details (including the access token).
   * If there's no user or an error, the OAuth flow is started.
   * @returns {Promise<User>}
   */
  withUser() {
    let user;
    try {
      const userRaw = window.localStorage.getItem('OpenShiftUser');
      if (userRaw) {
        user = JSON.parse(userRaw);
      }
    } catch (e) {
      console.error(e);
      window.localStorage.removeItem('OpenShiftUser');
    }

    if (!user) {
      return this.startOAuth();
    } else {
      return new Promise((resolve, reject) => {
        return resolve(user);
      });
    }
  }

  /**
   * Saves the user to local storage for retrieval of the token later as needed
   * @param {User} user 
   */
  setUser(user) {
    if (!user) {
      window.localStorage.setItem('OpenShiftUser', null);
      return;
    }
    window.localStorage.setItem('OpenShiftUser', JSON.stringify(user));
  }

  /**
   * Internal function to construct an oauth client from the oauth lib.
   */
  getOauthClient() {
    return new ClientOAuth2({
      clientId: this.config.clientId,
      accessTokenUri: this.config.accessTokenUri,
      authorizationUri: this.config.authorizationUri,
      redirectUri: this.config.redirectUri + '?then=' + window.location.href,
      scopes: this.config.scopes
    });
  }

  /**
   * Starts the OAuth flow, loading the configured authorize url.
   * Shouldn't need to be called manually.
   * This is called automatically by the library internals if an 
   * API call is attempted and there is no user details/access token.
   */
  startOAuth() {
    var openshiftAuth = this.getOauthClient();

    return window.location = openshiftAuth.token.getUri();
  }

  /**
   * Finish the oauth flow, retrieving the access token, and passing
   * data back to the user in a Promise.
   * The returned object has 2 keys: `user` & `then`
   * `user` has the access_token and some other user data
   * `then` has the original url from before the oauth flow started
   *  (useful if you want to restore the route the user was on)
   * @returns {Promise<AuthData>}
   */
  finishOAuth() {
    var openshiftAuth = this.getOauthClient();

    return openshiftAuth.token.getToken(window.location.href).then(function (user) {
      this.setUser(user.data);
      const then = this.getParameterByName('then');
      return {
        user: user,
        then: then
      };
    });
  }

  /**
   * Removes the user session from local storage.
   * Doing this will trigger an oauth flow the next time
   * the library is used. It is recommended to handle the 
   * logout state change in your App by navigating elsewhere
   * or reloading your App.
   */
  logout() {
    this.setUser(null)
  }

  /**
   * Retrieve a single parameter value from a URL that contains a query string
   * @param {string} name The parameter name to get
   * @param {string} url The full URL that includes the query string
   * @returns {string} The parameter value
   */
  getParameterByName(name, url) {
    if (!url) url = window.location.href;
    name = name.replace(/[\[\]]/g, '\\$&');
    var regex = new RegExp('[?&]' + name + '(=([^&#]*)|&|#|$)'),
      results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, ' '));
  }

  /**
   * Get a ProvisionedService from a specified namespace, by name.
   * @param {string} namespace The namespace to find the service in.
   * @param {string} serviceName The name of the service to retrieve.
   * @returns {Promise<ProvisionedService>}
   */
  getProvisionedMWService(namespace, serviceName) {
    if (this.config.mockData) {
      return MockProvisionedServiceClient.getProvisionedService();
    }

    this.withUser().then((user) => {
      return this.provisionedServiceClient.getProvisionedService(user.access_token, namespace, serviceName);
    });
  }

  /**
   * Retrieve a list of provisioned services in a namespace.
   * @param {string} namespace
   * @returns {Promise<ProvisionedService>}
   */
  listProvisionedMWServices(namespace) {
    if (this.config.mockData) {
      return MockProvisionedServiceClient.listProvisionedServices();
    }

    return this.withUser().then((user) => {
      return this.provisionedServiceClient.listProvisionedServices(user.access_token, namespace);
    });
  }
}

export default class ClusterServiceClass {
  /**
   * Construct a new {@link ClusterServiceClass}
   * @param {string} name The identifying name of the cluster service class
   * @param {string} displayName The human-friendly name of the cluster service class
   */
  constructor(name, displayName) {
    this.name = name;
    this.displayName = displayName;
  }

  /**
   * Return whether the provided JSON data is parsable by @see fromJSON
   * This returning false does not mean the actual object is invalid in OpenShift.
   * @param {Object} jsonData The JSON object to check
   * @returns {boolean}
   */
  static isValidJSON(jsonData) {
    return (jsonData && jsonData.metadata && jsonData.metadata.name
      && jsonData.spec && jsonData.spec.externalMetadata && jsonData.spec.externalMetadata.displayName);
  }

  /**
   * Create a new {@link ClusterServiceClass} from a provided JSON object.
   * @param {Object} jsonData The JSON object to parse
   * @returns {ClusterServiceClass}
   */
  static fromJSON(jsonData) {
    return new ClusterServiceClass(jsonData.metadata.name, jsonData.spec.externalMetadata.displayName);
  }
}

export default class ProvisionedService {
  /**
   * Construct a new {@link ProvisionedService}.
   * @constructor
   * @param {string} name The name of the service
   * @param {string} consoleURL The dashboard URL of the service
   * @param {ClusterServiceClass} service The cluster service class
   */
  constructor(name, consoleURL, service) {
    this.name = name;
    this.consoleURL = consoleURL;
    this.service = service;
  }
}

export default class ServiceInstance {
  constructor(name, consoleURL, clusterServiceClassId) {
    this.name = name;
    this.consoleURL = consoleURL;
    this.clusterServiceClassId = clusterServiceClassId;
  }

  static fromJSON(jsonData) {
    const { name } = jsonData.metadata;
    const consoleURL = jsonData.status.dashboardURL;
    const clusterServiceClassId = jsonData.spec.clusterServiceClassRef.name;

    return new ServiceInstance(name, consoleURL, clusterServiceClassId);
  }
}

# OpenShift Resource Parser

A library for retrieving and parsing various OpenShift resources.
You will need to set configuration when creating a new instance.

```
const config = {
  mockData: <enable_mock_data>
  clientId: '<openshift_oauthclient_id>',
  accessTokenUri: '<openshift_access_token_uri>',
  authorizationUri: '<openshift_authorize_uri>',
  redirectUri: '<openshift_redirect_uri>',
  scopes: [<user scopes>],
  masterUri: '<openshift_master_uri>'
};
```

For example, with a local openshift cluster:

```js
const config = {
  clientId: 'my-app',
  accessTokenUri: 'https://localhost:8443/oauth/token',
  authorizationUri: 'https://localhost:8443/oauth/authorize',
  redirectUri: 'http://myapp.example.com/oauth/callback',
  scopes: ['user:full'],
  masterUri: 'https://localhost:8443'
};

const parser = new OpenShiftResourceParser(config);
```

When you attempt to use the library, and a user has not authorized yet, the OAuth flow will start automatically.
However, if you want to *manually* start the OAuth flow, you can call the following:

```js
parser.startOAuth()
```

You will need to add an oauth callback route (e.g. `/oauth/callback`) to your App.
This route should call the below code to finish the oauth flow to get an access token:

```js
parser.finishOAuth().then(function (data) {
  // retrieve access token if you need it for other things
  console.log('access token', data.user.access_token);

  // redirect to the original url before oauth flow started
  const url = new URL(data.then);
  history.push(url.pathname);
});
```

To logout, call the below function:

```js
parser.logout();
```

